import React from 'react'

const WeatherInfo = (props) => {
    return (

        <span style={{marginTop: 30}}>
            <div>{props.weatherInfo.city}</div>
            <div>{props.weatherInfo.temp}</div>
            <div>{props.weatherInfo.temp_min}</div>
            <div>{props.weatherInfo.temp_max}</div>
            <div>{props.weatherInfo.pressure}</div>
        </span>

    )
}

export default WeatherInfo
